import { TextField } from "@material-ui/core";
import Button from '@material-ui/core/Button';

export default function SignUpForm() {
  return (
    <form autoComplete="off">
      <TextField
        id="standard-full-width"
        label="username"
        style={{ margin: 8 }}
        placeholder="@jim"
        fullWidth
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
      />
      <TextField
        type="email"
        id="standard-full-width"
        label="email"
        placeholder="jack@chitter.com"
        fullWidth
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
      />
      <TextField
        type="password"
        id="standard-full-width"
        label="password"
        style={{ margin: 8 }}
        placeholder="***********"
        fullWidth
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
      />
      <TextField
        type="password"
        id="standard-full-width"
        label="confirm password"
        style={{ margin: 8 }}
        placeholder="***********"
        fullWidth
        margin="normal"
        InputLabelProps={{
          shrink: true,
        }}
      />
      <Button variant="contained" color="primary">
        Submit
      </Button>
    </form>
  );
}
